import Navtop from './Navtop';
import{ useState } from 'react';
import './navbar.css';
import {IconContext} from 'react-icons'
import { BsBell , BsChatDots , BsCalendar , BsThreeDots} from "react-icons/bs";
import { HiOutlineUserGroup , HiOutlineShoppingBag } from "react-icons/hi";
import { IoCallOutline , IoHelpCircleSharp , IoHelpCircleOutline } from "react-icons/io5";
import { AiOutlineFile , AiOutlineAppstoreAdd } from "react-icons/ai";

function Navbar(){
    function NavHandler(event){
        event.target.classList.add('.active')
    }
    return(
        <IconContext.Provider value={ {color:"white" , size:"1.3em"} }>
            <div className='Navbar-wrapper'>
            <div className='Navbar-topitem'>
                <Navtop></Navtop> icon={<BsBell onMouseOver={NavHandler}/>} title='Activity'/> 
                <Navtop></Navtop> icon={<BsChatDots/>} title='Chats'/>
                <Navtop></Navtop> icon={<HiOutlineUserGroup/>} title='Teams'/>
                <Navtop></Navtop> icon={<HiOutlineShoppingBag/>} title='Assignments'/>
                <Navtop></Navtop> icon={<BsCalendar/>} title='Calendar'/>
                <Navtop></Navtop> icon={<IoCallOutline/>} title='Calls'/>
                <Navtop></Navtop> icon={<AiOutlineFile/>} title='Files'/>
                <Navtop></Navtop> icon={<BsThreeDots/>} title=''/>

            </div>
            <div className='Navbar-bottomitem'>
                <Navtop></Navtop> icon={<AiOutlineAppstoreAdd/>} title='Apps'/>
                <Navtop></Navtop> icon={<IoHelpCircleOutline/>} title='Help'/>


            </div>

        </div>
        </IconContext.Provider>

    );
}

export default Navbar;
